import React, { Component } from "react";
import axios from "axios";

import logo from "./logo.svg";
import "./App.css";

const data = "abc";

axios.get("http://127.0.0.1:5000/").then(res => {
  data = res;
});

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>{data}</p>
        </header>
      </div>
    );
  }
}

export default App;
